import jsTPS_Transaction from "../common/jsTPS.js"

export default class EditSong_Transaction extends jsTPS_Transaction {
    constructor(initStore, index, originalsong, newsong) {
        super();
        this.store = initStore;
        this.index = index
        this.originalsong = originalsong
        this.newsong = newsong
    }

    doTransaction() {
        this.store.editSong(index, newsong.title, newsong.artist, newsong.youTubeId);
    }

    undoTransaction() {
        this.store.editSong(index, originalsong.title, originalsong.artist, originalsong.youTubeId);
    }
}
